import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Image from 'react-bootstrap/Image';
import '../mainprofile.css';
export default function Mainprofile() {
  const profileStyle = {
    backgroundColor: 'lightblue',
    padding: '20px',
    borderRadius: '5px',
    boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
  };
  return (
     <Card className= "profile-card">
      <Card.Img variant="top" src="https://scontent-ord5-2.xx.fbcdn.net/v/t1.18169-9/26907988_385104481941548_4442023779868954759_n.png?_nc_cat=107&ccb=1-7&_nc_sid=5f2048&_nc_ohc=yhMi2v1WFoAQ7kNvgFKCikp&_nc_ht=scontent-ord5-2.xx&oh=00_AYDAUd281uslMT7imWf4AgvEHWgEcgTty7yCUlSNmiI9Xg&oe=66996582" />
      <Image className = "profile-photo" src="https://wallpapers.com/images/high/cool-profile-pictures-monkey-face-0jxwmq6bpm3hs9cb.webp"/>
      <Card.Body>
        <Card.Title>Bhuwan Bhandari</Card.Title>
        <Card.Text>

        </Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  )
}
